import styled from "styled-components";

export const ButtonStyle = styled("button")`
  position: absolute;
  display: flex;
  align-items: center;
  width: 324px;
  height: 49px;
  background: rgba(250, 84, 243, 0.23);
  border: 1px solid #f4f4f4;
  border-radius: 16px;

  position: absolute;
  width: 139px;
  height: 21px;
  left: 118px;
  top: 672px;

  font-family: "Epilogue";
  font-style: normal;
  font-weight: 700;
  font-size: 20px;
  line-height: 20px;
  /* identical to box height */

  color: rgba(0, 0, 0, 0.75);
`;
